import React from "react";
import "./Post.css";
const Post = (props) => {
  return (
    <div id="blog">
      <h2 className="headings">BLOG</h2>
      <div className="row">
        {props.posts.map((post) => {
          return (
            <div className="blog" key={post.id}>
              <img className="image" src={post.imgUrl} alt="post" />
              <p>{post.body}</p>
              <div className="info">
                <h4 className="place">- {post.place}</h4>
              </div>
            </div>
          )
        })}
      </div>
    </div>
  );
};
export default Post;
